Best Butt In The West 2
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

Description: Carlton Shits, world famous entrepreneur, invites us into his financial kingdom built around one big idea; The Firm Butt. In the process, TT rams JR Carrington Dough and St. Croix go wild on Missy. There's an awesome 4-way with Nikki, Heather and friends. Dough, Sid Deuce and Kelly do some stovetop stuffin' in a kitchen. And Hustler calls the results &quot;Fully Erect, Our Highest Rating.&quot; Catch Will Divide, the original Pussyman producer, In his debut feature for Coast to Coast Productions. It's about butt. And man is it hot!

Cast: Jenteal, J.R. Carrington, Nici Sterling, Jill Kelly, Missy, Lennox, Sid Deuce, Caressa Savage, Heather Lee, Peter North, Jon Dough

